%[text] Venn图，支持双圈或三圈
%[text] ## 语法
%[text] ```matlabCodeExample
%[text] Circles=MATLAB.Graphics.Venn(Matrix);
%[text] %绘制双圈Venn图
%[text] 
%[text] Circles=MATLAB.Graphics.Venn(Tensor);
%[text] %绘制三圈Venn图
%[text] 
%[text] Circles=MATLAB.Graphics.Venn(___,CircleStyles);
%[text] %与上述任意语法组合使用，额外指定每个圆圈的样式
%[text] 
%[text] [Circles,Texts]=MATLAB.Graphics.Venn(___,Tags);
%[text] %与上述任意语法组合使用，额外指定每个圆圈和重叠处的标签
%[text] 
%[text] [Circles,Texts]=MATLAB.Graphics.Venn(___,TagStyles);
%[text] %与上述任意语法组合使用，额外指定标签的样式
%[text] ```
%[text] ## 示例
%[text] ### 双圈图
%[text] ```matlabCodeExample
%[text] figure;
%[text] Data=reshape(0:3,2,2);
%[text] MATLAB.Graphics.Venn(Data,table([0,0,0;0,1,0],[1/2;1/2],'VariableNames',["FaceColor","FaceAlpha"]),string(Data),struct(Color=[1,0.5,1]));
%[text] MATLAB.Graphics.FigureAspectRatio(8,5);
%[text] axis off
%[text] ```
%[text] ## ![](text:image:0d10)
%[text] 包含0的双圈图：
%[text] ```matlabCodeExample
%[text] figure;
%[text] Data=reshape([1,1,0,1],2,2);
%[text] MATLAB.Graphics.Venn(Data,string(Data));
%[text] MATLAB.Graphics.FigureAspectRatio(1,1,1/2);
%[text] ```
%[text] ### ![](text:image:603f)
%[text] ### 三圈图
%[text] ```matlabCodeExample
%[text] figure;
%[text] Data=reshape(0:7,2,2,2);
%[text] legend(MATLAB.Graphics.Venn(Data,table([1,1,0;0,0,0;0,1,1],[1/3;1/3;1/3],'VariableNames',["FaceColor","FaceAlpha"]),string(Data),struct(Color=[1,0,1])),["A","B","C"]);
%[text] MATLAB.Graphics.FigureAspectRatio(1,1,1/2);
%[text] axis off
%[text] ```
%[text] 三圈图只能尽量拟合比例，不能保证相同
%[text] ## ![](text:image:7496)
%[text] 包含0的三圈图
%[text] ```matlabCodeExample
%[text] figure;
%[text] Data=reshape([1,0,1,1,1,0,1,0],2,2,2);
%[text] legend(MATLAB.Graphics.Venn(Data,string(Data)),string(1:3));
%[text] MATLAB.Graphics.FigureAspectRatio(8,5,1/2);
%[text] axis off
%[text] ```
%[text] 尽量符合实际比例，但不可能做到：
%[text] ![](text:image:283f)
%[text] 三圈图的某些标签位置可能需要 Statistics and Machine Learning Toolbox 才能得到更好的优化。缺少此工具箱仍能使用，但某些标签位置可能需要后期手工修正。
%[text] ## 输入参数
%[text] Matrix(2,2)数据矩阵，两个维度的两个数分别表示两个圈外/内的分量，即：
%[text] $\\mathrm{Matrix}=\\left\\lbrack \\begin{array}{cc}\n\\mathrm{\\textrm{圈}1\\textrm{外}\\textrm{圈}2\\textrm{外}\\textrm{分}\\textrm{量}} & \\mathrm{\\textrm{圈}1\\textrm{外}\\textrm{圈}2\\textrm{内}\\textrm{分}\\textrm{量}}\\\\\n\\mathrm{\\textrm{圈}1\\textrm{内}\\textrm{圈}2\\textrm{外}\\textrm{分}\\textrm{量}} & \\mathrm{\\textrm{圈}1\\textrm{内}\\textrm{圈}2\\textrm{内}\\textrm{分}\\textrm{量}}\n\\end{array}\\right\\rbrack${"editStyle":"visual"}
%[text] Tensor(2,2,2)数据张量，三个维度的两个数分别表示三个圈外/内的分量，类似于Matrix。即：
%[text] ```
%[text] Tensor(:,:,1) = 
%[text] 
%[text]      圈1外圈2外圈3外分量      圈1外圈2内圈3外分量 
%[text]      圈1内圈2外圈3外分量      圈1内圈2内圈3外分量 
%[text] 
%[text] 
%[text] Tensor(:,:,2) = 
%[text] 
%[text]      圈1外圈2外圈3内分量      圈1外圈2内圈3内分量 
%[text]      圈1内圈2外圈3内分量      圈1内圈2内圈3内分量 
%[text] ```
%[text] CircleStyles(2:3,:)tabular，列出每个圈的样式，一行一个圈，一列一种样式，列名就是样式名称。可选的样式列包括：
%[text] - Center(:,2)，该圈的中心点建议坐标。对于双圈图，一定会严格遵照建议作图；对于三圈图，三个圈都会尽可能绘制在建议点附近。
%[text] - 其它polyshape.plot函数接受的名称值参数，每行指定该参数对于对应该圈的值。 \
%[text] Tags string，每个分量的标签，必须与输入的Matrix或Tensor尺寸相同，将在每个分量对应的分区上标注文本。
%[text] TagStyles(1,1)struct，为所有文本应用的样式参数，可以是任何text函数接受的名称值参数对组作为结构体的字段和值。
%[text] ## 返回值
%[text] Circles(1,2:3)matlab.graphics.primitive.Polygon，绘制的两个或三个圈，允许进行后续操作
%[text] Texts matlab.graphics.Graphics，标签文本对象，允许进行后续操作，与Tags一一对应。
%[text] **See also** [polyshape.plot](<matlab:doc polyshape.plot>) [text](<matlab:doc text>) [matlab.graphics.primitive.Polygon](<matlab:doc matlab.graphics.primitive.Polygon>) [matlab.graphics.Graphics](<matlab:doc matlab.graphics.Graphics>)
function [Circles,Texts]=Venn(Tensor,varargin)
persistent DefaultCS2 DefaultCS3
if isempty(DefaultCS2)
	DefaultCS2=table([1,0,1;0,1,0],[0.5;0.5],'VariableNames',["FaceColor","FaceAlpha"]);
	DefaultCS3=table([0,0.5,1;0,1,0;1,0,1],[1/3;1/3;1/3],'VariableNames',["FaceColor","FaceAlpha"]);
end
HasTags=false;
Tensor2D=ismatrix(Tensor);
if Tensor2D
	CircleStyles=DefaultCS2;
else
	CircleStyles=DefaultCS3;
end
TagStyles=struct;
for V=1:numel(varargin)
	Arg=varargin{V};
	if isstruct(Arg)
		TagStyles=MATLAB.DataTypes.MergeStructs(Arg,TagStyles);
	elseif istabular(Arg)
		CircleStyles(:,Arg.Properties.VariableNames)=Arg;
	else
		HasTags=true;
		Tags=Arg;
	end
end
TagStyles=[fieldnames(TagStyles),struct2cell(TagStyles)].';
if Tensor2D
	Areas=[sum(Tensor(2,:));sum(Tensor(:,2))];
	Radius=sqrt(Areas);
	DefaultDistance=abs(Radius(1)-Radius(2));
	DefaultDistance=acos(sqrt(Tensor(2,2)/min(Areas))*2-1)/pi*(Radius(1)+Radius(2)-DefaultDistance)+DefaultDistance;
	if any(CircleStyles.Properties.VariableNames=="Center")
		Centers=CircleStyles.Center;
		ActualDistance=norm(Centers(1,:)-Centers(2,:));
		Radius=Radius*ActualDistance/DefaultDistance;
		CircleStyles.Center=[];
	else
		ActualDistance=DefaultDistance;
		DefaultDistance=DefaultDistance/2;
		Centers=[-DefaultDistance,0;DefaultDistance,0];
	end
	if isempty(CircleStyles)
		Circles(1)=polybuffer(Centers(1,:),'points',Radius(1)).plot;
		hold on;
		Circles(2)=polybuffer(Centers(2,:),'points',Radius(2)).plot;
	else
		CircleStyles=[CircleStyles.Properties.VariableNames;table2cell(CircleStyles)];
		Circles(1)=polybuffer(Centers(1,:),'points',Radius(1)).plot(CircleStyles{1:2,:});
		hold on;
		Circles(2)=polybuffer(Centers(2,:),'points',Radius(2)).plot(CircleStyles{[1,3],:});
	end
	if HasTags
		Edges=(Centers(1,:)-Centers(2,:))/ActualDistance;
		Edges=Centers+Radius.*cat(3,Edges,-Edges);
		TextCenters(:,3)=(Edges(1,:,2)+Edges(2,:,1))/2;
		TextCenters(:,2)=(Edges(1,:,2)+Edges(2,:,2))/2;
		TextCenters(:,1)=(Edges(1,:,1)+Edges(2,:,1))/2;
		Texts(2:4)=text(TextCenters(1,:),TextCenters(2,:),Tags(2:end),TagStyles{:},HorizontalAlignment='center',VerticalAlignment='middle');
		Texts=reshape(Texts,2,2);
	end
else
	Areas=[sum(Tensor(2,:,:),'all');sum(Tensor(:,2,:),'all');sum(Tensor(:,:,2),'all')];
	Radius=sqrt(Areas);
	Radius1=circshift(Radius,1,1);
	DefaultDistance=abs(Radius-Radius1);
	DefaultDistance=acos(sqrt([sum(Tensor(2,:,2));sum(Tensor(2,2,:));sum(Tensor(:,2,2))]./min(Areas,circshift(Areas,1,1)))*2-1)/pi.*(Radius+Radius1-DefaultDistance)+DefaultDistance;
	[~,LongEdge]=max(DefaultDistance);
	ShortEdges=setdiff(1:3,LongEdge);
	if sum(DefaultDistance(ShortEdges))<DefaultDistance(LongEdge)
		DefaultDistance(LongEdge)=sum(DefaultDistance)/2;
		DefaultDistance(ShortEdges)=DefaultDistance(ShortEdges)*DefaultDistance(LongEdge)/sum(DefaultDistance(ShortEdges));
	end
	if any(CircleStyles.Properties.VariableNames=="Center")
		Centers=fitTriangleByRatio(CircleStyles.Center.',DefaultDistance).';
		Radius=Radius*sum(vecnorm(circshift(Centers,1,1)-Centers,2,2))/sum(DefaultDistance);
		CircleStyles.Center=[];
	else
		Centers=ConstructTriangleBySides(circshift(DefaultDistance,1,1)).';
		Centers=Centers-mean(Centers,1); %中心化
	end
	if isempty(CircleStyles)
		Circles(1)=polybuffer(Centers(1,:),'points',Radius(1)).plot;
		hold on;
		Circles(2)=polybuffer(Centers(2,:),'points',Radius(2)).plot;
		Circles(3)=polybuffer(Centers(3,:),'points',Radius(3)).plot;
	else
		CircleStyles=[CircleStyles.Properties.VariableNames;table2cell(CircleStyles)];
		Circles(1)=polybuffer(Centers(1,:),'points',Radius(1)).plot(CircleStyles{1:2,:});
		hold on;
		Circles(2)=polybuffer(Centers(2,:),'points',Radius(2)).plot(CircleStyles{[1,3],:});
		Circles(3)=polybuffer(Centers(3,:),'points',Radius(3)).plot(CircleStyles{[1,4],:});
	end
	if HasTags
		[A,B]=bounds(cat(3,Centers+Radius,Centers-Radius),[1,3]);
		Positions=MATLAB.ElMat.LinSpace(A,B,100,1);
		InOutCircles=(Positions-permute(Centers,[3,2,1])).^2;
		Radius=Radius.^2;
		InOutCircles=InOutCircles(:,1,:)+pagetranspose(InOutCircles(:,2,:))<permute(Radius,[2,3,1]);
		InOutCircles=cat(4,~InOutCircles,InOutCircles);
		Logical=fliplr(dec2bin(1:7,3)-'0').';
		for R=7:-1:1
			TextCenters(:,R)=GetTextCenter(InOutCircles,Logical(:,R),Positions,Centers,Radius);
		end
		Texts(2:8)=text(TextCenters(1,:),TextCenters(2,:),Tags(2:end),TagStyles{:},HorizontalAlignment='center',VerticalAlignment='middle');
		Texts=reshape(Texts,2,2,2);
	end
end
end
function TextCenter=GetTextCenter(InOutCircles,InOut,Positions,Centers,Radius)
persistent HasKmeans
if isempty(HasKmeans)
	HasKmeans=~isempty(which('kmeans'));
end
Index=InOut+1;
[A,B]=find(InOutCircles(:,:,1,Index(1))&InOutCircles(:,:,2,Index(2))&InOutCircles(:,:,3,Index(3)));
if isempty(A)
	TextCenter=NaN;
else
	RegionPoints=[Positions(A,1),Positions(B,2)];
	TextCenter=mean(RegionPoints,1);
	if ~isequal(sum((TextCenter-Centers).^2,2)<Radius,InOut)
		if HasKmeans
			[Index,TextCenter]=kmeans(RegionPoints,2);
			[~,Index]=max(groupcounts(Index));
			TextCenter=TextCenter(Index,:);
		else
			MATLAB.Exception.Venn_Tag_position_may_be_wrong.Warn('需要 Statistics and Machine Learning Toolbox 以进一步优化标签位置');
		end
	end
end
end
function OptimizedCenters = fitTriangleByRatio(Centers,OppositeSides)
% 构造初始三角形（两种可能方向）
X=ConstructTriangleBySides(OppositeSides);
% 计算变换后的三角形
[Y1, e1] = applySimilarityTransform(X, Centers);
X(end)=-X(end);
[Y2, e2] = applySimilarityTransform(X, Centers);
% 选择误差更小的变换
if e1 <= e2
	OptimizedCenters = Y1;
else
	OptimizedCenters = Y2;
end
end
function Triangle=ConstructTriangleBySides(OppositeSides)
OSSquare=OppositeSides.^2;
Triangle = (OSSquare(2) + OSSquare(3) - OSSquare(1)) / (2*OppositeSides(3));
Triangle=[[0; 0], [OppositeSides(3); 0], [Triangle; real(sqrt(OSSquare(2) - Triangle^2))]];
%假定输入边长满足三角形条件，直接取实部
end
function [Y_transformed, error] = applySimilarityTransform(X, Centers)
% 计算最优相似变换(缩放+旋转+平移)并应用
% 中心化
mu_X = mean(X, 2);
mu_Y = mean(Centers, 2);
X0 = X - mu_X;
Y0 = Centers - mu_Y;
% 计算缩放因子
sigma_X =  sum(X0.^2,'all')/3; % 点集方差
if abs(sigma_X) < eps
	% 退化情况（点集重合）
	s = 1;
	R = eye(2);
else
	% 计算协方差矩阵
	Sigma = Y0 * X0'/3;

	% 奇异值分解
	[U, ~, V] = svd(Sigma);

	% 计算旋转矩阵（允许反射）
	R = U * V';

	% 计算缩放因子
	s = trace(Sigma' * R) / sigma_X;
end
% 应用变换
Y_transformed = s * R * X + mu_Y - s * R * mu_X;
% 计算误差（与目标点的距离平方和）
error = sum((Y_transformed - Centers).^2,'all');
end

